import Todo from "./Todo";

const TodoList = ({ tasks, onDelete, onEdit, showEdit }) => {
  return (
    <>
      {tasks.map((task) => (
        <Todo key={task.id} task={task} onDelete={onDelete} onEdit={onEdit} />
      ))}
    </>
  );
};

export default TodoList;
